import React from 'react';

export default function withData(maxSpeakerToShow) {
    return function withData(Component){
        const speakers = [
            {
                imgSrc: 'speaker-component-1124.png',
                name: 'Douglas'
            },
            {
                imgSrc: 'speaker-component-1530.png',
                name: 'Tamara'
            },
            {
                imgSrc: 'speaker-component-10803.png',
                name: 'Eugene'
            }
        ];
        return function() {
            const limitSpeakers = speakers.slice(0, maxSpeakerToShow);
            return <Component speakers={limitSpeakers}/>
        };
    }
}
